import React from 'react'
import {Link} from 'react-router-dom';

export default function Navbar() {
    return (
        <div className="nav-bar">
           <Link style={{textDecoration:'none',color:'whitesmoke',alignSelf:'flex-start',fontWeight:'lighter',marginLeft:'10px'}} to='/' >
               <h3>Dashboard</h3>
           </Link>
           <h2 className="app-header">Voice Trade</h2>
           <Link className="portf" style={{textDecoration:'none',color:'whitesmoke',alignSelf:'flex-end',fontWeight:'lighter',position:'absolute', right:'2vw'}} to="/portfolio">
               <h3>Go to portfolio</h3>
           </Link>
        </div>
    );
};
